                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    return TryGet<int?>.Succeed((int)Furnature_FieldIndex.Name);
                case 0x4C444F4D: // MODL
